char** findHighAccessEmployees(char*** access_times, int access_timesSize, int* access_timesColSize, int* returnSize) {
    char **result = (char**)malloc(access_timesSize * sizeof(char*));
    int *accessCounts = (int*)calloc(access_timesSize, sizeof(int));
    int resultCount = 0;

    for (int i = 0; i < access_timesSize; i++) {
        int count = 1;
        for (int j = i + 1; j < access_timesSize; j++) {
            if (strcmp(access_times[i][0], access_times[j][0]) == 0) {
                int time1 = atoi(access_times[i][1]);
                int time2 = atoi(access_times[j][1]);
                int hourDiff = abs(time2 / 100 - time1 / 100);
                int minuteDiff = abs(time2 % 100 - time1 % 100);
                if (hourDiff == 0 || (hourDiff == 1 && minuteDiff == 0)) {
                    count++;
                }
            }
        }
        if (count >= 3) {
            int exists = 0;
            for (int k = 0; k < resultCount; k++) {
                if (strcmp(result[k], access_times[i][0]) == 0) {
                    exists = 1;
                    break;
                }
            }
            if (!exists) {
                result[resultCount] = (char*)malloc(strlen(access_times[i][0]) + 1);
                strcpy(result[resultCount], access_times[i][0]);
                resultCount++;
            }
        }
    }

    *returnSize = resultCount;
    return result;
